import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import './contact.css';
import axios from 'axios';
import {CardContent, Container, Typography} from "@mui/material";
import Paper from "@mui/material/Paper";
import myImg from "./images/about.jpg";

function ContactPage() {

    return (
        <Container className="contact-container" maxWidth="lg">
            <Paper elevation={10} className="paper" sx={{backgroundColor: 'black'}}>
                <card sx={{ maxWidth: 345 }}>
                    <CardContent>
                        <Typography gutterBottom variant="h5" component="div">
                            card
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                            sddsds
                        </Typography>
                    </CardContent>
                </card>
                <Typography className="description" sx={{color: 'white'}}>
                    dddd
                </Typography>
            </Paper>
        </Container>
    );
}

export default ContactPage;
